import { createApp } from 'vue'
import App from './App.vue'

import $ from 'jquery'
window.$ = $

import api from './api/index.js'
window.api = api
window.Data = {}


import store from './store';

import { useStore } from 'vuex';
window.store = useStore()

const app = createApp(App)
app.use(store)
app.mount('#app')
